/* eslint-disable jsx-a11y/anchor-has-content */
import React from 'react';
// import PropTypes from 'prop-types';
import { FormattedMessage, useIntl } from 'react-intl';
import { Link } from 'react-router-dom';
import messages from './messages';

const links = [
  {
    id: 1,
    href: 'https://web.garaaz.com/',
    target: '_blank',
    children: <FormattedMessage {...messages.garaazLink} />,
  },
  {
    id: 2,
    // href: 'https://web.garaaz.com/',
    target: '_blank',
    children: <FormattedMessage {...messages.aboutUsLink} />,
  },
  {
    id: 3,
    // href: 'https://web.garaaz.com/',
    target: '_blank',
    children: <FormattedMessage {...messages.contactUsLink} />,
  },
  // {
  //   href: 'https://web.garaaz.com/',
  //   target: '_blank',
  //   children: <FormattedMessage {...messages.licensesLink} />,
  // },
];

const FooterAdmin = () => {
  const intl = useIntl();

  return (
    <>
      <footer className='block' style={{ paddingTop: 4 , paddingBottom: 20 }}>
        <div className='container mx-auto px-4'>
          {/* <hr className="mb-4 border-b-1 border-blueGray-200" /> */}
          <div className='flex flex-wrap items-center md:justify-between justify-center'>
            <div className='w-full md:w-6/12 px-4'>
              <div className='text-center mb-2 md:text-left md:mb-0'>
                <a
                  // href='https://garaaz.com'
                  target='_blank'
                  className='text-sm text-blueGray-500 font-semibold py-1 text-center md:text-left'
                >
                  {`${intl.formatMessage(
                    messages.copyright,
                  )} © 2019-${new Date().getFullYear()} ${intl.formatMessage(
                    messages.svanAutotech,
                  )}`}
                </a>
              </div>
            </div>
            <div className='w-full md:w-6/12 px-4'>
              <ul className='flex flex-wrap list-none md:justify-end  justify-center'>
                {links.map((prop) => (
                  <li key={prop.id}>
                    {prop.to && (
                      <Link
                        {...prop}
                        className='text-blueGray-700 hover:text-blueGray-900 text-sm font-semibold block py-1 px-3'
                      />
                    )}
                    {prop.to === undefined && (
                      <a
                        key={prop.id}
                        {...prop}
                        className='text-blueGray-700 hover:text-blueGray-900 text-sm font-semibold block py-1 px-3'
                      />
                    )}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </footer>
    </>
  );
};

// FooterAdmin.propTypes = {
//   links: PropTypes.arrayOf(PropTypes.object),
// };

export default FooterAdmin;
